        private void AddToGDT(bool dualwield = false)
        {
            if (dualwield)
            {
                t7template = Regex.Replace(t7template, "bulletweapon.gdf", "dualwieldweapon.gdf");
            }

            using (OpenFileDialog ofd = new OpenFileDialog())
            {
                ofd.Filter = "Game Data Table (*.gdt)|*.gdt";
                ofd.RestoreDirectory = true;
                ofd.Multiselect = false;
                ofd.Title = "Select Target .GDT";
                if (ofd.ShowDialog() == DialogResult.OK)
                {
                    using (StreamReader sr = new StreamReader(ofd.FileName))
                    {
                        dump = sr.ReadToEnd();
                    }
                    string pattern = "[{\r\n\t]+";
                    Regex rgx = new Regex(pattern);
                    newgdt = rgx.Replace(dump, "{\r\n" + t7template + "\r\n\t", 1);
                    //System.Diagnostics.Debug.WriteLine(newgdt);
                    //System.Diagnostics.Debug.WriteLine(ofd.FileName);
                    File.WriteAllText(ofd.FileName, newgdt);
                    toolStripStatusLabel1.Text = "Weapon successfully added to " + ofd.FileName;
                }
            }
        }

        private void SaveNewGDT(bool dualwield = false)
        {
            if (dualwield)
            {
                t7template = Regex.Replace(t7template, "bulletweapon.gdf", "dualwieldweapon.gdf");
            }
            using (SaveFileDialog sfd = new SaveFileDialog())
            {
                sfd.RestoreDirectory = true;
                sfd.Filter = "Game Data Table (*.gdt)|*.gdt";
                sfd.Title = "Select save location";
                if (sfd.ShowDialog() == DialogResult.OK)
                {
                    File.WriteAllText(sfd.FileName, "{\r\n" + t7template + "\r\n}");
                }
            }
        }
